INSERT INTO film(id,imdb_id,judul,ringkasan,popularitas,kategori_dewasa,durasi,pendapatan,biaya_pembuatan,tanggal_rilis,jumlah_vote,rerata_vote,jumlah_pemeran,genre_1,genre_2,genre_3,genre_4,negara_1,negara_2,negara_3,negara_4,perusahaan_1,perusahaan_2,perusahaan_3,perusahaan_4,jumlah_terjemahan,pemeran_utama_1,pemeran_utama_2,pemeran_utama_3,pemeran_utama_4,pemeran_utama_5,rata2_pop_pemeran) VALUES (268922,'tt5658714','Marmut Merah Jambu','Suatu hari Dika (Raditya Dika) datang ke rumah Ina (Anjani Dina), cinta pertamanya sewaktu SMA, membawa seribu origami burung bangau di tangan kanannya, dan undangan pernikahan Ina di tangan kirinya. Besok, Ina akan menikah. Kedatangan Dika diterima oleh Bapak Ina (Tio Pakusadewo) yang curiga kedatangan Dika untuk kasus cinta lama yang belum selesai dan berpikir bahwa Dika ingin menggagalkan pernikahan anaknya. Dika menceritakan maksud sebenarnya, yang jauh dari tuduhan Bapak Ina.  Seiring dengan Dika bercerita, kita melihat masa lalu Dika (Christoffer Nelwan). Pada masa ini, Dika SMA jatuh cinta diam-diam kepada Ina.  Di masa sekarang, seiring dengan Dika bercerita, seiring itu pula dia sadar: ada yang belum selesai dari masa lalunya. Seiring itu pula dia bertanya: benarkah cinta pertama tidak akan kemana-mana?',0.638,'False',91,0,0,'2014-05-08',7,7.1,60,18.0,35.0,10749.0,NULL,'ID',NULL,NULL,NULL,14140.0,NULL,NULL,NULL,2,1061161.0,1600647.0,1828201.0,1828199.0,1828198.0,'1.1896499999999992');
