INSERT INTO film(id,imdb_id,judul,ringkasan,popularitas,kategori_dewasa,durasi,pendapatan,biaya_pembuatan,tanggal_rilis,jumlah_vote,rerata_vote,jumlah_pemeran,genre_1,genre_2,genre_3,genre_4,negara_1,negara_2,negara_3,negara_4,perusahaan_1,perusahaan_2,perusahaan_3,perusahaan_4,jumlah_terjemahan,pemeran_utama_1,pemeran_utama_2,pemeran_utama_3,pemeran_utama_4,pemeran_utama_5,rata2_pop_pemeran) VALUES (414607,NULL,'Me And You Vs The World','Kehidupan Jeremy (Rio Dewanto) yang mulai bosan dengan pekerjaan dan rutinitas kantorannya berubah ketika dia bertemu dengan Sera (Dhea Seto) yang juga sedang mencari jati dirinya dan bosan dengan dunia remaja yang menurutnya monoton.  Awal pertemuan ketika Jeremy sedang presentasi soal rafting dengan Kepala Sekolah (Joe P. Project). Presentasi Jeremy di tolak karena dianggap terlalu berbahaya untuk anak-anak SMU, dan Sera juga ikut menolak untuk kegiatan itu. Sebenarnya Bos Jeremy (Piyu) juga menolak rencana Jeremy. Tetapi Jeremy dan Baron (Gofar Hilman) tidak menyerah.',0.779,'False',90,0,0,'2014-04-14',0,0.0,12,12.0,35.0,10749.0,NULL,'ID',NULL,NULL,NULL,7872.0,NULL,NULL,NULL,2,1028460.0,1675757.0,1202419.0,1675759.0,1675762.0,'1.7164166666666667');
INSERT INTO film(id,imdb_id,judul,ringkasan,popularitas,kategori_dewasa,durasi,pendapatan,biaya_pembuatan,tanggal_rilis,jumlah_vote,rerata_vote,jumlah_pemeran,genre_1,genre_2,genre_3,genre_4,negara_1,negara_2,negara_3,negara_4,perusahaan_1,perusahaan_2,perusahaan_3,perusahaan_4,jumlah_terjemahan,pemeran_utama_1,pemeran_utama_2,pemeran_utama_3,pemeran_utama_4,pemeran_utama_5,rata2_pop_pemeran) VALUES (646705,'tt11708788','Mekah I''m Coming','Hubungan Eddy, pemilik usaha bengkel desa, dan Eni bisa kandas lantaran Eni akan dijodohkan dengan saudagar kaya dari kota, Pietoyo. Berkat saran Ibunya, Eddy berhasil merayu orangtua Eni dengan mengatakan akan berangkat Haji tahun ini. Faktanya, untuk mendapatkan kuota visa Haji resmi harus mengantri selama 10 tahun. Eddy memutuskan menjual bengkel tempat usahanya, dan mengambil jalur kilat. Sesampainya di Jakarta, Eddy baru sadar kalau ia ditipu. Dalam kebimbangan, Eddy harus menyembunyikan hal tersebut dari siapapun. Ia menunggu waktu yang tepat untuk pulang kampung, agar seolah-olah ia benar-benar naik Haji dan bisa segera menikahi Eni.',0.917,'False',96,0,0,'2020-03-05',2,8.5,46,35.0,18.0,NULL,NULL,'ID',NULL,NULL,NULL,5344.0,37348.0,NULL,NULL,2,1646036.0,1645578.0,553543.0,1826302.0,1259328.0,'0.7464782608695658');
INSERT INTO film(id,imdb_id,judul,ringkasan,popularitas,kategori_dewasa,durasi,pendapatan,biaya_pembuatan,tanggal_rilis,jumlah_vote,rerata_vote,jumlah_pemeran,genre_1,genre_2,genre_3,genre_4,negara_1,negara_2,negara_3,negara_4,perusahaan_1,perusahaan_2,perusahaan_3,perusahaan_4,jumlah_terjemahan,pemeran_utama_1,pemeran_utama_2,pemeran_utama_3,pemeran_utama_4,pemeran_utama_5,rata2_pop_pemeran) VALUES (773510,'tt1067238','Si Kabayan dan Anak Jin','Si Kabayan (Didi Petet) jadi santri di sebuah pesantren untuk bisa mendekati Nyi Iteung (Nike Ardilla), anak tunggal pimpinan atau Ajengan Pesantren. Dalam usahanya ini ia dibantu anak jin yang semula mengganggunya, tapi lalu bersahabat bahkan bisa menampakkan diri (Sena A. Utoyo). Suatu hari datang teman Ajengan, pak Cokro (Moortri Purnomo), untuk membalas budi yang pernah diterimanya. Iteung diminta disekolahkan di IAIN Yogya. Iteung pergi, Kabayan kesepian. Di Yogya, Iteung terpaksa bergaul akrab dengan Jerry (Regi Reygusta Ninda) keponakan bu Cokro (Yetti Syarifah). Mereka diharap berjodoh. Anak Cokro sendiri, Budiman (Jef Elva Koswara) yang belajar juga di pesantren, memberitahu Kabayan bahwa Jerry itu pecandu narkotik. Maka berangkatlah Kabayan ke Yogya. Iteung ternyata sudah dijual ke sindikat narkotik. Dengan bantuan anak jin, Kabayan berhasil menyelamatkan Iteung',1.09,'False',95,0,0,'1991-01-01',0,0.0,4,18.0,35.0,NULL,NULL,'ID',NULL,NULL,NULL,145197.0,NULL,NULL,NULL,1,553546.0,1260484.0,2743521.0,1088694.0,NULL,'0.637');
