INSERT INTO film(id,imdb_id,judul,ringkasan,popularitas,kategori_dewasa,durasi,pendapatan,biaya_pembuatan,tanggal_rilis,jumlah_vote,rerata_vote,jumlah_pemeran,genre_1,genre_2,genre_3,genre_4,negara_1,negara_2,negara_3,negara_4,perusahaan_1,perusahaan_2,perusahaan_3,perusahaan_4,jumlah_terjemahan,pemeran_utama_1,pemeran_utama_2,pemeran_utama_3,pemeran_utama_4,pemeran_utama_5,rata2_pop_pemeran) VALUES (199324,'tt0274716','Petualangan Sherina','Ayah Sherina (Sherina Munaf), yaitu Darmawan (Mathias Muchus), insinyur pertanian, mendapatkan kerja pertanian sesuai dengan impiannya, Sherina ikut pindah ke Bandung Utara. Di sekolahnya yang baru, ia mendapat musuh, Sadam (Derby Romero), yang ternyata anak dari majikan Darmawan, Ardiwilaga (Didi Petet).  Hal ini diketahui Sherina saat berliburan ke rumah Ardiwilaga. Dalam kesempatan ini permusuhan kedua anak tadi berubah menjadi persahabatan, karena keduanya diculik oleh Pak Raden (Butet Kertaradjasa), suruhan Kertarejasa (Djaduk Ferianto), yang menguasai tanah pertanian Ardiwilaga, untuk proyek propertinya.',1.555,'False',93,1200000,250000,'2000-06-13',5,8.2,27,12.0,18.0,10402.0,10751.0,'ID',NULL,NULL,NULL,63782.0,63784.0,NULL,NULL,2,1179543.0,1179545.0,3249312.0,935317.0,553546.0,'0.9091481481481483');
