INSERT INTO film(id,imdb_id,judul,ringkasan,popularitas,kategori_dewasa,durasi,pendapatan,biaya_pembuatan,tanggal_rilis,jumlah_vote,rerata_vote,jumlah_pemeran,genre_1,genre_2,genre_3,genre_4,negara_1,negara_2,negara_3,negara_4,perusahaan_1,perusahaan_2,perusahaan_3,perusahaan_4,jumlah_terjemahan,pemeran_utama_1,pemeran_utama_2,pemeran_utama_3,pemeran_utama_4,pemeran_utama_5,rata2_pop_pemeran) VALUES (219048,NULL,'Manusia Setengah Salmon','Ketika ibunya (Dewi Irawan) memutuskan pindah dari rumah masa kecil, Dika (Raditya Dika), penulis, justru berusaha pindah dari hal-hal yang selama ini susah dilepaskan: cintanya dengan Jessica (Eriska Rein) hingga hubungannya dengan bapaknya (Bucek).  Dika membantu mencari rumah baru. Rumah yang mereka kunjungi ternyata tidak ada yang cocok. Akhirnya Dika menemukan sebuah rumah, yang menurut ibunya sempurna. Bersamaan dengan itu, Dika bertemu dengan Patricia (Kimberly Ryder) nan cantik. Pendekatan dimulai.  Ketika sudah pindah ternyata Dika tidak menyukai rumah barunya. Kenangan akan rumah lama masih membekas. Sementara itu, hubungan Dika dengan Patricia juga terganggu, karena Jessica masih membayang-bayangi. Dika pada akhirnya menyadari bahwa perjalanannya untuk pindah rumah, juga merupakan perjalanan berpindah dari hal-hal yang selama ini menahannya menuju kedewasaan.',0.864,'False',100,0,0,'2013-10-09',5,6.4,36,10749.0,35.0,18.0,NULL,'ID',NULL,NULL,NULL,14140.0,NULL,NULL,NULL,2,1061161.0,1258906.0,1202417.0,1202419.0,1202407.0,'0.9401666666666672');
