INSERT INTO film(id,imdb_id,judul,ringkasan,popularitas,kategori_dewasa,durasi,pendapatan,biaya_pembuatan,tanggal_rilis,jumlah_vote,rerata_vote,jumlah_pemeran,genre_1,genre_2,genre_3,genre_4,negara_1,negara_2,negara_3,negara_4,perusahaan_1,perusahaan_2,perusahaan_3,perusahaan_4,jumlah_terjemahan,pemeran_utama_1,pemeran_utama_2,pemeran_utama_3,pemeran_utama_4,pemeran_utama_5,rata2_pop_pemeran) VALUES (547311,NULL,'Moonrise Over Egypt','April 1947, empat utusan diplomatik Indonesia tiba di Kairo untuk mengupayakan pengakuan de jure atas kedaulatan Indonesia dari pemerintah Mesir. Mereka adalah Haji Agus Salim yang sekaligus menjadi pemimpin delegasi, Abdurrachman Baswedan, Mohammad Rasjidi, dan Nazir Datuk Sutan Pamuntjak. Ikhtiar Agus Salim dan kawan-kawannya tak semulus rencana. Duta Besar Belanda untuk Mesir, Willem Van Recteren Limpurg, melancarkan serangkaian siasat penggagalan. Didampingi Duta Besar Keliling Belanda Cornelis Adriaanse yang sengaja didatangkan secara khusus ke Kairo, Willem menggertak Pemerintah Mesir. Belanda akan mencabut segala dukungan untuk kepentingan luar negerinya, apabila Mesir mengakui kedaulatan Indonesia.',0.731,'False',114,0,0,'2018-03-22',0,0.0,4,18.0,36.0,NULL,NULL,'ID',NULL,NULL,NULL,57909.0,NULL,NULL,NULL,4,2124662.0,2124663.0,1207212.0,2124664.0,NULL,'0.603');
