INSERT INTO film(id,imdb_id,judul,ringkasan,popularitas,kategori_dewasa,durasi,pendapatan,biaya_pembuatan,tanggal_rilis,jumlah_vote,rerata_vote,jumlah_pemeran,genre_1,genre_2,genre_3,genre_4,negara_1,negara_2,negara_3,negara_4,perusahaan_1,perusahaan_2,perusahaan_3,perusahaan_4,jumlah_terjemahan,pemeran_utama_1,pemeran_utama_2,pemeran_utama_3,pemeran_utama_4,pemeran_utama_5,rata2_pop_pemeran) VALUES (217560,NULL,'Cinta Brontosaurus','Dika (Raditya Dika), penulis, baru saja putus cinta dengan Nina (Pamela Bowie). Semenjak itu, dia percaya bahwa cinta bisa kadaluarsa. Kosasih (Soleh Solihun), agen naskah Dika, mencoba untuk membuat Dika yakin terhadap cinta kembali, seperti Kosasih dengan istrinya Wanda (Tyas Mirasih). Usaha ini, membawa Dika ke dalam serangkaian perkenalan absurd.  Cinta bisa datang tanpa persiapan. Dika bertemu dengan Jessica (Eriska Rein), yang jalan pikirannya sama anehnya dengan Dika. Semakin Dika kenal dengan Jessica, semakin dia bertanya: apa benar cinta bisa kadaluarsa?  Sementara itu Soe Lim (Ronny P Tjandra), menawarkan memfilmkan buku Dika, Cinta Brontosaurus. Dika berusaha menulis skrip film tersebut. Masalah timbul ketika Soe Lim mencoba untuk mengubah naskah asli Dika menjadi film horror yang sedang laku.',0.6,'False',98,0,0,'2013-05-07',3,6.2,38,35.0,18.0,10749.0,NULL,'ID',NULL,NULL,NULL,14140.0,NULL,NULL,NULL,3,1061161.0,1202417.0,1202418.0,1202407.0,1157416.0,'1.021236842105264');
