INSERT INTO film(id,imdb_id,judul,ringkasan,popularitas,kategori_dewasa,durasi,pendapatan,biaya_pembuatan,tanggal_rilis,jumlah_vote,rerata_vote,jumlah_pemeran,genre_1,genre_2,genre_3,genre_4,negara_1,negara_2,negara_3,negara_4,perusahaan_1,perusahaan_2,perusahaan_3,perusahaan_4,jumlah_terjemahan,pemeran_utama_1,pemeran_utama_2,pemeran_utama_3,pemeran_utama_4,pemeran_utama_5,rata2_pop_pemeran) VALUES (580211,'tt1043520','Pelajaran Cinta','Kisah para pelajar SMA di Yogya yang umumnya berasal dari luar kota. Mereka ini mulai belajar kenal cinta dan seks. Tiga sahabat, Benny, Lesmono, dan Larso yang jadi pusat cerita. Benny yang jago cewek mengajari kawannya ke pelacur. Lesmono yang diam-diam mencintai Indri, hanya bisa gigit jari, karena ternyata jatuh ke tangan Benny, yang sangat bersikap enteng dalam hidup. Bahkan Benny berhasil menyelundupkan Indri ke kamar kosnya. Ketika ia pulang ke Jakarta, Indri waswas karena terlambat haid. Lesmono turun tangan mencari dukun untuk menggugurkan kandungan Indri. Ternyata Indri tidak hamil ketika periksa pada dokter. Lesmono mulai berbunga merasa bisa mendekati Indri. Ternyata ia harus tetap gigit jari, karena Indri kembali mesra pada Benny. Sebuah usaha untuk melukiskan psikologi para remaja dalam hubungannya dengan cinta dan seks, meski terlampau bermain-main dan dangkal.',0.6,'False',93,0,0,'1979-01-01',1,6.0,10,18.0,NULL,NULL,NULL,'ID',NULL,NULL,NULL,107030.0,NULL,NULL,NULL,2,1259253.0,1689840.0,2235314.0,2235316.0,1088055.0,'0.8718');
