INSERT INTO film(id,imdb_id,judul,ringkasan,popularitas,kategori_dewasa,durasi,pendapatan,biaya_pembuatan,tanggal_rilis,jumlah_vote,rerata_vote,jumlah_pemeran,genre_1,genre_2,genre_3,genre_4,negara_1,negara_2,negara_3,negara_4,perusahaan_1,perusahaan_2,perusahaan_3,perusahaan_4,jumlah_terjemahan,pemeran_utama_1,pemeran_utama_2,pemeran_utama_3,pemeran_utama_4,pemeran_utama_5,rata2_pop_pemeran) VALUES (579463,NULL,'Aerosmith at Super Bowl Music Fest','Festival Musik Super Bowl Bud Light yang pertama di State Farm Arena akan disiarkan langsung di Twitter di @sbmusicfest, mulai Kamis.  Ludacris akan naik panggung pada hari Kamis dengan Ciara dan Migos. Lil Yachty, Lil Baby, Metro Boomin, dan 21 Savage juga akan tampil.  Jumat, malam kedua headline epik - Aerosmith dan Post Malone - akan disiarkan langsung di akun Twitter resmi Bud Light dan di akun artis yang dinominasikan Grammy.  "Super senang bisa bermain di Super Bowl Music Festival bersama Aerosmith dan menghabiskan waktu bersama Bud Light fam," kata Malone dalam sebuah pernyataan kepada ORANG. "Ayo jadi aneh dan nyalakan boiiiii."  Festival musik berakhir pada hari Sabtu dengan penampilan Bruno Mars dan Cardi B. Tiket masih tersedia bagi mereka yang cukup beruntung untuk berada di selatan untuk pertandingan besar.',0.6,'False',80,0,0,'2019-02-01',0,0.0,0,10402.0,10402.0,NULL,NULL,'US',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL);
