INSERT INTO film(id,imdb_id,judul,ringkasan,popularitas,kategori_dewasa,durasi,pendapatan,biaya_pembuatan,tanggal_rilis,jumlah_vote,rerata_vote,jumlah_pemeran,genre_1,genre_2,genre_3,genre_4,negara_1,negara_2,negara_3,negara_4,perusahaan_1,perusahaan_2,perusahaan_3,perusahaan_4,jumlah_terjemahan,pemeran_utama_1,pemeran_utama_2,pemeran_utama_3,pemeran_utama_4,pemeran_utama_5,rata2_pop_pemeran) VALUES (869548,NULL,'Ngiring Belasungkawa','Sepeninggal ayahnya, seorang anak tunggal, hanya ingin mendoakan ayahnya dengan damai. Namun keinginannya tidak dapat dipenuhi karena tradisi yang memaksanya untuk mengurus pemakaman ayahnya. Dia dipaksa untuk membayar semua orang yang mengurus pemakaman dengan tarif yang telah ditentukan, termasuk yang mendoakan almarhum. Dia tahu itu salah dan dia menolak untuk mengikuti, tetapi dia terus ditekan oleh bibinya dan beberapa tetangga untuk mengikuti tradisi itu. Ia pun mengalami dilema, harus mengikuti tradisi untuk kelancaran penguburan ayahnya atau tetap pada pendiriannya. Banyak keluarga di Jawa Barat, Indonesia yang ditinggalkan oleh almarhum mengalami kesedihan yang mendalam dan terbebani menghadapi tradisi yang sebenarnya tidak mereka setujui.',0.6,'False',19,0,0,'2018-07-13',1,8.0,4,18.0,NULL,NULL,NULL,'ID',NULL,NULL,NULL,140407.0,160099.0,NULL,NULL,2,3219692.0,3219693.0,3219694.0,3671494.0,NULL,'0.6');
