INSERT INTO film(id,imdb_id,judul,ringkasan,popularitas,kategori_dewasa,durasi,pendapatan,biaya_pembuatan,tanggal_rilis,jumlah_vote,rerata_vote,jumlah_pemeran,genre_1,genre_2,genre_3,genre_4,negara_1,negara_2,negara_3,negara_4,perusahaan_1,perusahaan_2,perusahaan_3,perusahaan_4,jumlah_terjemahan,pemeran_utama_1,pemeran_utama_2,pemeran_utama_3,pemeran_utama_4,pemeran_utama_5,rata2_pop_pemeran) VALUES (654636,NULL,'Psikopat','Exel (Aga Dirgantara), Alisya (Marsya Doeni), Chrissy (Kezia Karamoy), dan Gigih (Idon Juan) diteror ketika berada di villa Randi (Iqbal Perdana). Mereka melihat hantu Lara (Baby Margaretha), yang menuntut penyelesaian kematian tidak wajarnya. Kasus pembunuhan berantai kemudian terungkap secara perlahan. Pertama, Gadis (Mila Cheah), pacar Randi, ditemukan tewas di vila. Berdasarkan penyelidikan polisi, Randi tidak ada di TKP ketika kekasihnya tewas pada 23:59. Di sisi lain, paranormal mengatakan bahwa Lara telah menjadi mayat yang dikumpulkan di bunker bersama mayat lainnya.',0.6,'False',78,0,0,'2017-07-27',0,0.0,5,27.0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,2478834.0,2478835.0,2478836.0,2056576.0,2455814.0,'0.676');
