INSERT INTO film(id,imdb_id,judul,ringkasan,popularitas,kategori_dewasa,durasi,pendapatan,biaya_pembuatan,tanggal_rilis,jumlah_vote,rerata_vote,jumlah_pemeran,genre_1,genre_2,genre_3,genre_4,negara_1,negara_2,negara_3,negara_4,perusahaan_1,perusahaan_2,perusahaan_3,perusahaan_4,jumlah_terjemahan,pemeran_utama_1,pemeran_utama_2,pemeran_utama_3,pemeran_utama_4,pemeran_utama_5,rata2_pop_pemeran) VALUES (651467,NULL,'Empat Brewok dari Goa Sanggreng','Seorang bayi diselamatkan Eyang Sinto Gendeng (Cherry Ivonne), karena kedua orangtuanya dibunuh Mahesabirawa (Yan Bastian), yang marah pacarnya dikawini orang lain. Bayi itu dilatih silat dan diberi senjata sakti, berupa sebuah kapak. Ia bernama Wiro Sableng (Tonny Hidayat). Lalu ia mencari pembunuh ayahnya yang dikabarkan sudah mati. Tinggal anak buahnya yang dipimpin Kalingundil (Gino Makasutji). Sementara itu ada empat orang yang dikenal sebagai Empat Brewok dari Goa Sanggreng, juga mencari Kalingundil dengan alasan ingin balas dendam juga. Maka terjadi perkelahian tiga pihak. Wiro Sableng menang, tapi pacarnya, Nilamsuri (Susan Aryani), anak Kalingundil, meninggal.',1.095,'False',0,0,0,'1988-01-01',0,0.0,6,35.0,28.0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,1294454.0,1691006.0,1646011.0,1691074.0,1358679.0,'0.774');
