INSERT INTO film(id,imdb_id,judul,ringkasan,popularitas,kategori_dewasa,durasi,pendapatan,biaya_pembuatan,tanggal_rilis,jumlah_vote,rerata_vote,jumlah_pemeran,genre_1,genre_2,genre_3,genre_4,negara_1,negara_2,negara_3,negara_4,perusahaan_1,perusahaan_2,perusahaan_3,perusahaan_4,jumlah_terjemahan,pemeran_utama_1,pemeran_utama_2,pemeran_utama_3,pemeran_utama_4,pemeran_utama_5,rata2_pop_pemeran) VALUES (644069,NULL,'Kata Maaf Terakhir','Darma menghadapi bulan terakhir hidupnya. Untuk mati dengan damai, ia ingin berdoa lima kali sehari, puasa selama sebulan penuh, dan menerima pengampunan dari mantan istrinya Dania dan dua anaknya, Reza dan Lara, yang ia tinggalkan setelah menghamili Alina, teman Dania. Hanya keinginan terakhir Darma yang belum terpenuhi sampai dia secara tidak sengaja bertemu Lara. Tetapi dia menolak keinginan rekonsiliasi ayahnya meskipun jauh di dalam hatinya, dia benar-benar merindukan kesempatan di mana dia dapat merangkul ayahnya lagi. Kemudian Darma mengungkapkan kepadanya bahwa dia sedang sekarat.',0.6,'False',95,0,0,'2009-08-27',0,0.0,7,18.0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,1454162.0,1155281.0,1157495.0,1158143.0,1972045.0,'0.9524285714285713');
INSERT INTO film(id,imdb_id,judul,ringkasan,popularitas,kategori_dewasa,durasi,pendapatan,biaya_pembuatan,tanggal_rilis,jumlah_vote,rerata_vote,jumlah_pemeran,genre_1,genre_2,genre_3,genre_4,negara_1,negara_2,negara_3,negara_4,perusahaan_1,perusahaan_2,perusahaan_3,perusahaan_4,jumlah_terjemahan,pemeran_utama_1,pemeran_utama_2,pemeran_utama_3,pemeran_utama_4,pemeran_utama_5,rata2_pop_pemeran) VALUES (643467,NULL,'Setan Facebook','Farah, 19, terobsesi oleh Facebook. Cici, sahabatnya, dan Nauvam, pacarnya, sering mengingatkannya untuk meluangkan waktu dari pembaruan terus-menerus atas pikirannya. Ketika Farah diundang untuk mengonfirmasi permintaan pertemanan dari Mira Anindhita, ia mengabaikannya. Tetapi teman-temannya, yang menanggapinya, jatuh ke kematian tragis yang tiba-tiba. Jadi Farah meminta Roni, seorang hacker, untuk melacak profil misterius yang mungkin menjadi penyebab kematian baru-baru ini. Selain itu, Farah bertemu Nenek Pujo, yang dikatakan menjadi kunci dari segalanya. Namun, Farah masih tidak bisa tenang, karena waktu juga hampir habis baginya.',0.6,'False',85,0,0,'2010-10-21',0,0.0,9,27.0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1308128.0,2443736.0,2443737.0,2443738.0,2443739.0,'0.6368888888888888');
INSERT INTO film(id,imdb_id,judul,ringkasan,popularitas,kategori_dewasa,durasi,pendapatan,biaya_pembuatan,tanggal_rilis,jumlah_vote,rerata_vote,jumlah_pemeran,genre_1,genre_2,genre_3,genre_4,negara_1,negara_2,negara_3,negara_4,perusahaan_1,perusahaan_2,perusahaan_3,perusahaan_4,jumlah_terjemahan,pemeran_utama_1,pemeran_utama_2,pemeran_utama_3,pemeran_utama_4,pemeran_utama_5,rata2_pop_pemeran) VALUES (643459,NULL,'Berkelana II','Budi alias Rhoma (Rhoma Irama) yang diusir di tengah jalan yang dihujani pengendara motor. Kawan-kawan Budi saat masih mengamen kebetulan menemukan Budi terluka. Budi dibawa kembali ke penginapan mereka dan dirawat. Sementara itu Ani (Yatie Octavia) harus berusaha mencari. Kebetulan, suatu hari di jalan dia bertemu dengan teman-teman Budi. Maka Ani bertemu Budi yang sedang sakit. Mereka kemudian sering bertemu sampai Surya mencurigai dan menangkap Ani di pondok Budi. Ani diseret pulang. Budi mengundang teman-temannya untuk berhenti bermain musik untuk mengemis. Dia sendiri adalah seorang sopir taksi, teman-temannya menjual koran, bekerja sebagai pekerja bangunan dll. Dan tiba-tiba Budi menyamar dengan kumis tebal dan kaca gelap muncul di rumah Ani, mengatakan bahwa kata temannya Ani ingin belajar piano. Jadi kencan gratis di rumah Ani. Sementara itu seorang penumpang taksi, yang mendengar Budi bernyanyi.',0.6,'False',76,0,0,'1978-09-14',0,0.0,10,18.0,10402.0,NULL,NULL,'ID',NULL,NULL,NULL,135141.0,NULL,NULL,NULL,2,2096434.0,1365821.0,1088694.0,1365820.0,1653939.0,'0.8516');
INSERT INTO film(id,imdb_id,judul,ringkasan,popularitas,kategori_dewasa,durasi,pendapatan,biaya_pembuatan,tanggal_rilis,jumlah_vote,rerata_vote,jumlah_pemeran,genre_1,genre_2,genre_3,genre_4,negara_1,negara_2,negara_3,negara_4,perusahaan_1,perusahaan_2,perusahaan_3,perusahaan_4,jumlah_terjemahan,pemeran_utama_1,pemeran_utama_2,pemeran_utama_3,pemeran_utama_4,pemeran_utama_5,rata2_pop_pemeran) VALUES (643456,NULL,'Berkelana','Subrata (Rachmat Hidayat), pengusaha dan ayah Rhoma (Rhoma Irama) di Bandung, mengarahkan putranya untuk menjadi lulusan ekonomi. Rhoma mengikuti sambil mengejar hasrat bermusik. Musik ini dilarang oleh Subrata, untuk sering konflik dan puncaknya ketika gitar favorit Rhoma dihancurkan oleh ayahnya dan dia dikeluarkan dari rumah. Kemudian Rhoma pergi ke Jakarta dan mengaku sebagai Budi. Dia tinggal dan bergaul dengan kelompok bernyanyi. Ketika salah satu temannya sakit parah dan membutuhkan banyak uang, dan permintaan bantuan ayahnya ditolak, Budi mengambil tas Ani (Yatie Octavia) yang disuruh oleh ayahnya untuk mengurus surat-surat rumah.',0.6,'False',121,0,0,'1978-09-17',0,0.0,10,18.0,10402.0,NULL,NULL,'ID',NULL,NULL,NULL,135141.0,NULL,NULL,NULL,2,2096434.0,1365821.0,1365820.0,1659206.0,1088694.0,'0.7971999999999999');
