INSERT INTO film(id,imdb_id,judul,ringkasan,popularitas,kategori_dewasa,durasi,pendapatan,biaya_pembuatan,tanggal_rilis,jumlah_vote,rerata_vote,jumlah_pemeran,genre_1,genre_2,genre_3,genre_4,negara_1,negara_2,negara_3,negara_4,perusahaan_1,perusahaan_2,perusahaan_3,perusahaan_4,jumlah_terjemahan,pemeran_utama_1,pemeran_utama_2,pemeran_utama_3,pemeran_utama_4,pemeran_utama_5,rata2_pop_pemeran) VALUES (642865,'tt1293609','Oh, My God!','Ipin adalah siswa sekolah menengah yang dianggap tua dibandingkan teman-teman sekelasnya. Karena masalah keuangan, ia selalu terlambat mendaftar ke sekolah. Tetapi ia memiliki bakat menyanyi yang unik, karena ia bernyanyi seperti Broery Pesolima, penyanyi papan atas di era 70-an. Kemudian Ipin jatuh cinta pada Tiara, seorang gadis cantik, kaya, dan pintar. Tapi Tiara adalah pacar Marco, kapten tim bola basket sekolah dan juara sampul favorit di majalah. Sekarang Marco akan melakukan apa saja untuk menghapus Ipin dari sekolah.',0.6,'False',0,0,0,'2008-08-01',0,0.0,4,35.0,18.0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1202412.0,1454162.0,1128893.0,1157389.0,NULL,'1.088');
INSERT INTO film(id,imdb_id,judul,ringkasan,popularitas,kategori_dewasa,durasi,pendapatan,biaya_pembuatan,tanggal_rilis,jumlah_vote,rerata_vote,jumlah_pemeran,genre_1,genre_2,genre_3,genre_4,negara_1,negara_2,negara_3,negara_4,perusahaan_1,perusahaan_2,perusahaan_3,perusahaan_4,jumlah_terjemahan,pemeran_utama_1,pemeran_utama_2,pemeran_utama_3,pemeran_utama_4,pemeran_utama_5,rata2_pop_pemeran) VALUES (642860,'tt1356800','Kalau Cinta Jangan Cengeng','Boy, seorang bintang film terkenal, memiliki masa lalu yang kelam, karena ia terlibat dalam kecelakaan mobil yang menewaskan dua orang. Kemudian, ia menjadi Duta Besar untuk kampanye Anti Narkoba dan memberikan ceramah di pusat rehabilitasi. Di sana ia melihat seorang pecandu yang menyerupai orang yang meninggal dalam kecelakaan bertahun-tahun yang lalu. Dia adalah Yani, putri pasangan yang sudah meninggal, yang dia selamatkan dalam kecelakaan itu. Karena merasa bersalah, Boy mencoba membantu Yani untuk pulih dari kecanduannya. Kemudian Yani melarikan diri dari pusat dan mulai menggunakan narkoba lagi dengan Felix, pengedarnya. Boy menemukannya dan membawanya pulang. Ini membuat pacar Boy, Luna, marah. Tetapi ketika hubungan Boy dengan Yani semakin dekat, mantan manajer Boy, Ahmad, memberi tahu Yani bahwa Boy yang membunuh orangtuanya.',0.6,'False',112,0,0,'2008-02-12',0,0.0,3,18.0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1663776.0,1128893.0,235429.0,NULL,NULL,'1.1926666666666668');
