INSERT INTO film(id,imdb_id,judul,ringkasan,popularitas,kategori_dewasa,durasi,pendapatan,biaya_pembuatan,tanggal_rilis,jumlah_vote,rerata_vote,jumlah_pemeran,genre_1,genre_2,genre_3,genre_4,negara_1,negara_2,negara_3,negara_4,perusahaan_1,perusahaan_2,perusahaan_3,perusahaan_4,jumlah_terjemahan,pemeran_utama_1,pemeran_utama_2,pemeran_utama_3,pemeran_utama_4,pemeran_utama_5,rata2_pop_pemeran) VALUES (609619,'tt10324148','Mendadak Kaya','Karena sejumlah permasalahan, Doyok, Otoy, dan Ali Oncom terpaksa harus menghasilkan uang banyak dalam waktu singkat. Mereka terpaksa melakukan aksi tipu-tipu dan terlibat transaksi misterius antargangster. Peristiwa itu justru membawa keuntungan. Mereka berhasil membawa kabur uang miliyaran rupiah dan impian mereka menjadi orang kaya pun tercapai. Namun, mereka tidak paham jika kekayaan tersebut juga menghadirkan petaka.',0.6,'False',92,0,0,'2019-06-20',2,5.0,8,35.0,NULL,NULL,NULL,'ID',NULL,NULL,NULL,5344.0,104948.0,NULL,NULL,2,1185537.0,1368174.0,1158143.0,1202409.0,2046541.0,'1.944');
INSERT INTO film(id,imdb_id,judul,ringkasan,popularitas,kategori_dewasa,durasi,pendapatan,biaya_pembuatan,tanggal_rilis,jumlah_vote,rerata_vote,jumlah_pemeran,genre_1,genre_2,genre_3,genre_4,negara_1,negara_2,negara_3,negara_4,perusahaan_1,perusahaan_2,perusahaan_3,perusahaan_4,jumlah_terjemahan,pemeran_utama_1,pemeran_utama_2,pemeran_utama_3,pemeran_utama_4,pemeran_utama_5,rata2_pop_pemeran) VALUES (609618,'tt10462650','Rumah Merah Putih','Farel, Oscar, dan kawan-kawannya yang tinggal di perbatasan NTT-Timor Leste mengikuti lomba panjat pinang. Namun, bukannya bersatu, mereka berdebat hadiah mana yang harus diambil lebih dulu. Mereka gagal dan kemudian menyalahkan satu sama lain. Masalah semakin rumit ketika dua kaleng cat merah putih milik Farel hilang. Takut dimarahi ayahnya, Farel, Oscar, dan kawan-kawannya berupaya mengumpulkan uang untuk membeli cat. Mereka mengetahui akan ada lomba panjat pinang lagi berhadiah cat merah putih. Saat lomba, Oscar terjatuh dan sakit. Ini kisah Farel, Oscar, dan kawan-kawannya untuk merayakan 17 Agustus.',0.6,'False',96,0,0,'2019-06-20',1,7.0,0,18.0,NULL,NULL,NULL,'ID',NULL,NULL,NULL,31521.0,NULL,NULL,NULL,2,NULL,NULL,NULL,NULL,NULL,NULL);
